import './App.css';
import Home from './components/Home';
import ExperimentCompareImages from './components/Experiment';
import { BrowserRouter as Routes, Route, Link , BrowserRouter} from 'react-router-dom';
import { render } from "react-dom";
import React,  { useState } from 'react';

export default function App() {

  const [started, setStarted] = useState(false);

  const startApp = () => {
    setStarted(true);
  };

  render(
    <BrowserRouter>
      <Routes>
          <div>
            <nav>
              <ul>
                <li>
                  <Link to="/">Home</Link>
                </li>
                {started && (
                  <li>
                    <Link to="/another-view">Another View</Link>
                  </li>
                )}
              </ul>
            </nav>

            <button onClick={startApp}>Start</button>
            <Route path="/" exact component={Home} />
            <Route path="/" exact component={ExperimentCompareImages} />
          </div>
        </Routes>
      </BrowserRouter>
  );
}
